import React from "react";
import Modal from "react-bootstrap/Modal";
import Button from "react-bootstrap/Button";
import "../css/MainScreen.css";
import AdvisorPic from "../img/rubyProfile.jpg";

const LoginModal = (props) => {
  return (
    <>
      <Modal show={props.modalOpen} onHide={props.handleModalOpen}>
        <Modal.Header closeButton class="close1" data-dismiss="modal">
          <Modal.Title>Advisor Information</Modal.Title>
          {/* <buttonClose closeButton class="close1" data-dismiss="modal">
            <span>&times;</span>
          </buttonClose> */}
        </Modal.Header>
        <Modal.Body>
          <div class="modal-body">
            <div class="row2" id="modalBody">
              <img src="../img/rubyProfile.jpg" width="150px" height="150 px" />
              <div class="col">
                <h6>Advisor Name: Professor Ruby</h6>
                <h6>Email: ruby.elkharboutly@quinnipiac.edu</h6>
                <h6>Phone: 203-123-4556</h6>
                <h6>Office: CCE-030</h6>
              </div>
            </div>
          </div>
        </Modal.Body>
        <Modal.Footer>
          <Button variant="danger" onClick={props.handleModalOpen}>
            Cancel
          </Button>
        </Modal.Footer>
      </Modal>
    </>
  );
};

export default LoginModal;
